// import react from 'react';
import { Box, Typography } from '@mui/material';

const styles = StyleSheet.create({
  main: {
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center',
    alignItems: 'center',
    width: '98vw',
    backgroundColor: 'darkseagreen'
  }
})

function App() {
  return (
    <Box sx={styles.main}>
      <Box  >
        <Typography>New Site!</Typography>
      </Box>
    </Box>
  );
}

export default App;
